import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Header.css';

export default function Header({ backgroundColor, textColor }) {
  return (
    <nav className="head" style={{ backgroundColor: backgroundColor, color: textColor }}>
      <Link to="/" className="site-title" style={{ color: textColor }}>Portfolio</Link>
      <ul>
        <li><Link to="/Home" style={{ color: textColor }}>Home</Link></li>
        <li><Link to="/About" style={{ color: textColor }}>About</Link></li>
        <li><Link to="/Experience" style={{ color: textColor }}>Experience</Link></li>
        <li><Link to="/Work" style={{ color: textColor }}>Work</Link></li>
      </ul>
    </nav>
  );
}
